inline std::complex<double>
M_tot_uu_UXu_pow0_1(double Dn_p1mk2_MQ, double Dn_p2mk3, double K2K3,
                    std::complex<double> LCC1nm4u3Um2nuU, std::complex<double> LCC2nm4um6U4nuU,
                    std::complex<double> LCC5nm4um1U2nuU, std::complex<double> LCC8nm4u3Um2nuU,
                    double MQ, double MX, double Nc, double P1K2, double P1K3,
                    std::complex<double> RCC1nm4u3Um2nuU, std::complex<double> RCC1u4um6g2,
                    std::complex<double> RCC1um3um1g1, std::complex<double> RCC2nm4um6U4nuU,
                    std::complex<double> RCC2um3um1g1, std::complex<double> RCC5nm4um1U2nuU,
                    std::complex<double> RCC5um3um6g3, std::complex<double> RCC8nm4u3Um2nuU,
                    std::complex<double> RCC8u4um1g2, std::complex<double> RCC8um3um6g1,
                    double alpha_s, double dM2o, std::complex<double> rDn_k2pk3MU_pow1,
                    std::complex<double> rDn_k2pk3MU_pow2, double s, double s1) {

  std::complex<double> M_tot_uu_UXu_pow0_1_result;
  M_tot_uu_UXu_pow0_1_result =
      4.0 * std::pow(M_PI, 2.0) * std::pow(Nc, -2.0) * std::pow(alpha_s, 2.0) *
      (1.0 - 1.0 * std::pow(Nc, 2.0)) *
      ((std::pow(RCC2um3um1g1, 2.0) * norm(LCC2nm4um6U4nuU) +
        std::pow(RCC2um3um1g1, 2.0) * norm(RCC2nm4um6U4nuU)) *
           M_tot_uu_UXu_pow0_1_16(P1K2, P1K3, s) +
       (std::pow(RCC5um3um6g3, 2.0) * norm(LCC5nm4um1U2nuU) +
        std::pow(RCC5um3um6g3, 2.0) * norm(RCC5nm4um1U2nuU)) *
           M_tot_uu_UXu_pow0_1_2(Dn_p1mk2_MQ, Dn_p2mk3, K2K3, MQ, MX, P1K3, dM2o) +
       (std::pow(RCC1u4um6g2, 2.0) * std::pow(RCC1um3um1g1, 2.0) * norm(LCC1nm4u3Um2nuU) +
        std::pow(RCC1u4um6g2, 2.0) * std::pow(RCC1um3um1g1, 2.0) * norm(RCC1nm4u3Um2nuU)) *
           M_tot_uu_UXu_pow0_1_6(K2K3, P1K2, P1K3, dM2o, s, s1) +
       (std::pow(RCC2um3um1g1, 2.0) * rDn_k2pk3MU_pow1 * norm(LCC2nm4um6U4nuU) +
        std::pow(RCC2um3um1g1, 2.0) * rDn_k2pk3MU_pow1 * norm(RCC2nm4um6U4nuU)) *
           M_tot_uu_UXu_pow0_1_14(MQ, MX, P1K2, P1K3, dM2o, s) +
       (std::pow(RCC2um3um1g1, 2.0) * rDn_k2pk3MU_pow2 * norm(LCC2nm4um6U4nuU) +
        std::pow(RCC2um3um1g1, 2.0) * rDn_k2pk3MU_pow2 * norm(RCC2nm4um6U4nuU)) *
           M_tot_uu_UXu_pow0_1_12(MQ, P1K2, P1K3, dM2o, s) +
       (std::pow(RCC8u4um1g2, 2.0) * std::pow(RCC8um3um6g1, 2.0) * norm(LCC8nm4u3Um2nuU) +
        std::pow(RCC8u4um1g2, 2.0) * std::pow(RCC8um3um6g1, 2.0) * norm(RCC8nm4u3Um2nuU)) *
           M_tot_uu_UXu_pow0_1_3(Dn_p2mk3, K2K3, P1K2, P1K3, dM2o, s1) +
       (LCC2nm4um6U4nuU * RCC1u4um6g2 * RCC1um3um1g1 * RCC2um3um1g1 * conj(LCC1nm4u3Um2nuU) +
        RCC1u4um6g2 * RCC1um3um1g1 * RCC2nm4um6U4nuU * RCC2um3um1g1 * conj(RCC1nm4u3Um2nuU)) *
           M_tot_uu_UXu_pow0_1_10(K2K3, P1K2, P1K3, dM2o, s, s1) +
       (LCC8nm4u3Um2nuU * RCC5um3um6g3 * RCC8u4um1g2 * RCC8um3um6g1 * conj(LCC5nm4um1U2nuU) +
        RCC5um3um6g3 * RCC8nm4u3Um2nuU * RCC8u4um1g2 * RCC8um3um6g1 * conj(RCC5nm4um1U2nuU)) *
           M_tot_uu_UXu_pow0_1_0(Dn_p1mk2_MQ, Dn_p2mk3, K2K3, MQ, MX, P1K2, P1K3, dM2o, s1) +
       (LCC2nm4um6U4nuU * RCC1u4um6g2 * RCC1um3um1g1 * RCC2um3um1g1 * rDn_k2pk3MU_pow1 *
            conj(LCC1nm4u3Um2nuU) +
        RCC1u4um6g2 * RCC1um3um1g1 * RCC2nm4um6U4nuU * RCC2um3um1g1 * rDn_k2pk3MU_pow1 *
            conj(RCC1nm4u3Um2nuU)) *
           M_tot_uu_UXu_pow0_1_8(MQ, MX, P1K2, P1K3, dM2o, s, s1));
  return M_tot_uu_UXu_pow0_1_result;
}

